import { combineReducers } from "redux";

const initstate = {};

const Reducer = (state = initstate, action) => {
  console.log(state);
  switch (action.type) {
    default:
      return state;
  }
};

const rootReducer = combineReducers({
  reducer: Reducer
});

export default rootReducer;
